import React from 'react';

const Navbar = () => (
    <div
        className="bg-gray-900 text-red-800 flex justify-end gap-10 text-white px-10">
        <a className="navbar-brand" href="/">Home</a>
        <a className="navbar-brand" href="/about">About</a>
        <a className="navbar-brand" href="/contact">Contact</a>
        <a className="navbar-brand" href="/calendly">Calendly</a>
        <a className="navbar-brand" href="/projects">Projects</a>
    </div>
)


export default Navbar;
